import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

function Home() {
  const [roomId, setRoomId] = useState(""); // Initialize roomId with an empty string
  const navigate = useNavigate();

  const handleJoin = () => {
    navigate(`/room/${roomId}`);
  };

  return (
    <main style={styles.container}>
    <h1 style={styles.heading}>Enter the Room ID to join the meeting</h1>
      <input
        type="text"
        placeholder="Enter room Id"
        value={roomId}
        onChange={(e) => setRoomId(e.target.value)} // Update roomId when the input value changes
      />
      <button onClick={handleJoin}>Join</button>
    </main>
  );
}
const styles = {
    container: {
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      justifyContent: 'center',
     
    },
    heading: {
      marginBottom: '20px',
      fontSize: '24px',
    },
    input: {
      padding: '10px',
      marginBottom: '20px',
      width: '300px',
      borderRadius: '5px',
      border: '1px solid #ccc',
    },
    button: {
      padding: '10px 20px',
      backgroundColor: '#007bff',
      color: '#fff',
      borderRadius: '5px',
      border: 'none',
      cursor: 'pointer',
      fontSize: '16px',
    },
  };
export default Home;
